import React from "react"; 
import {Container, Image} from "react-bootstrap";
import CardBack from "./back.png"

const Back = (props) => {

    return(
        <div className = "img">        
            <Container>
        <Image src = {CardBack}fluid> {props.CardBack}
        </Image> 
        </Container></div>

    )
}

export default Back;
